import React from "react";
import Link from "next/Link";

export default function ContactPage() {
  console.log("*****************Contact Component*******************");
  return (
    <div>
      <h1>Contact Page</h1>
      <p>Never contact us about anything</p>
      <Link href="/">
        <a>Index</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
    </div>
  );
}
